import * as carousel from "@ibrains-design/carousel"
import { normalizeProps, useMachine } from "@ibrains-design/react"

export function Carousel() {
  const [state, send] = useMachine(carousel.machine({ id: "1" }))

  const api = carousel.connect(state, send, normalizeProps)

  return (
    <div {...api.getRootProps()}>
      <button {...api.getPrevTriggerProps()}>Prev</button>
      <button {...api.getNextTriggerProps()}>Next</button>
      <div {...api.getViewportProps()}>
        <div {...api.getItemGroupProps()}>
          {items.map((image, index) => (
            <div {...api.getItemProps({ index })} key={index}>
              <img
                src={image}
                alt=""
                style={{ height: "300px", width: "100%", objectFit: "cover" }}
              />
            </div>
          ))}
        </div>
      </div>
    </div>
  )
}

const items = [
  "https://tinyurl.com/5b6ka8jd",
  "https://tinyurl.com/7rmccdn5",
  "https://tinyurl.com/59jxz9uu",
]
